int main()
 {
   FILE *pFile;
   pFile = fopen("D2-D1.txt","w");
   double x[NPAD][NENT],h[NINTER],o[NSAI],y[NPAD][NSAI],delta1[NINTER],delta2[NSAI],w1[NENT][NINTER],w2[NINTER][NSAI],erro,erromax;
   int m;
  // unsigned long l;
   int l;
   system("cls");
   fprintf(pFile,"Aprendizagem da Rede\n");
   printf("Aprendizagem da Rede\n");
   conjunto_treinamento1(x,y);
   inicializa_pesos(w1,w2);
   erromax = ACEITAVEL*2.0;
   m = 0;
   l = 0;
   while(erromax > ACEITAVEL && l < MAXITER)
     {
      if(m == NPAD) m = 0;
      intermediaria(x,w1,h,m);
      saida(h,w2,o);
      err=erro_saida(o,y,m);
      if(err > erromax) erromax = err;
      erro2(o,y,m,delta2);
      erro1(h,delta2,w2,delta1);
      ajusta2(w2,delta2,h);
      ajusta1(w1,delta1,x,m);
      l = l + 1;
      printf("\nPadrao>>%d",m);
      m = m + 1;
      printf("\t\t Epoca:%d \t\t Erro:%2.9f",l,err);
    }
   // getch();
    fprintf(pFile,"\n\nVERIFICACAO\n");
    printf("\n\nVERIFICACAO\n");
    verifica1(x,w1,w2,y,pFile);
    fclose (pFile);
   // getch();
    return 0;
   }

